[task_collection] Add filter-no-collection to ignore the collection

This code allows to prevent the collection of repositories listed in the
projects.json by adding `--filter-no-collection=true` to the corresponding lines.
Tests have been provided accordingly.

An example of projects.json is shown below:
{
  "grimoire": {
    "git": [
        "https://github.com/VizGrimoire/GrimoireLib --filter-no-collection=true",
        "https://github.com/MetricsGrimoire/CMetrics"
    ]
  }
}

Signed-off-by: Quan Zhou <zhquan7@gmail.com>

[aliases] Handle complex aliases

This code reshapes the aliases.json, which now
is able to handle complex aliases. The new format
allows to define a list of aliases with/without filters.
An example of a new alias is provided below:
```
"github2:issue": {
    "raw": [
      {
        "alias": "github2_issues-raw"
      }
    ],
    "enrich": [
      {
        "alias": "github2_issues"
      },
      {
        "alias": "github2_pull_requests",
        "filter": {
          "terms": {
            "issue_pull_request" : [
              "true"
            ]
          }
        }
      },
      {
        "alias": "affiliations"
      },
      {
        "alias": "all_enriched"
      }
    ]
  },
```

Signed-off-by: Valerio Cosentino <valcos@bitergia.com>
